import React from 'react';

export default function TrackCard({ artist, title, albumImageUrl }) {

    return (
        <div className="ml-10 mr-20 my-5 flex rounded-lg shadow-lg" >
            <img className="w-28 rounded-l-lg" src={albumImageUrl} alt="Album Art" ></img>
            <div className="ml-5 flex flex-col justify-center" >
                <div className="items-center text-xl pb-3" >{artist}</div>
                <div className="items-center text-sm" >{title}</div>
            </div>
        </div>
    )
}
